import React, {Component} from 'react';


class App extends Component{

  constructor(props){
    super(props);
    this.state = {
      cartList: []
    }
  }

  componentDidMount() {
     fetch("http://jsonplaceholder.typicode.com/todos").then(data => data.json()).then(data =>this.setState({cartList: data})).catch(console.log);
  }
  render() {
    return (
      <div>
          <h1>Welcome to Shop-R-Us!</h1>
          this.state.cartList.map(e =>  {
          <div className="container">
        <div className="col-xs-12">
        <h1>Your current Cart:</h1>
          <div className = "data">
            <scope className = "row">
            <p className="elements">
             {this.e.title} {this.e.description} {this.e.completed} {e.userId}
            </p>
            </scope>
           </div> 
        )}
        </div>
        </div>
    });
      </div>
    );
  }

}

export default App;
